import { Grid , Container} from '@mui/material';
import React from 'react';
import CardWithButton from './molecules/CardWithButton';
import being_boss from './atoms/images/being-boss.png';
import beyond from './atoms/images/beyondEntrepreneur.png';
import two from './atoms/images/2.png';
import Cards from './molecules/Cards';

interface Props{

}

const TrendingBlink=(props:Props)=> {
    return (
        <>
        <Container>
           <Grid container rowSpacing={2} spacing={4}>
               <Grid item md={4}>
                    <CardWithButton variant='text' imag={being_boss} name="Being Boss" author="Kathleen Shannon and Emily..." duration="13"/>
               </Grid>
               <Grid item md={4}>
                   <CardWithButton variant='text' imag={beyond} name="Beyond Entrepreneurship" author="Jim Collins & Bill Lazier" duration="12" noOfReads='1.9'/>
               </Grid>
               <Grid item md={4}>
               <CardWithButton imag={two} name="Employee to Entrepreneur" author="Steve Glaveski" duration="15"/>
                </Grid>
            </Grid> 
        </Container>
        </>
    );
}

export default TrendingBlink;
